import React from "react";

class RegistrationStep6 extends React.Component{
    constructor(props){
        super(props)
        this.state={
            placement: ""
        }
        this.placementChange = this.placementChange.bind(this)
    }

    placementChange(e){
        console.log(e.target.value)
        this.setState({
            placement: e.target.value
        })
    }

    render(){
        return(
            <>
                <h1 className="header-title">Input your <span className="header-title-yellow">network</span></h1>
                 <h1 className="header-title" >details</h1>
                 <div className="network-details">
                    <label className="label">Direct Referral RC</label>
                    <input type="text" className="custom-input2" />
                    <label className="label">Placement</label>
                    <input type="text" className="custom-input2" />
                    <Wrapper>
                        <Item>
                            <RadioButton
                            type="radio"
                            name="radio"
                            value="betterPriceOnly"
                            checked={select === "betterPriceOnly"}
                            onChange={this.placementChange}
                            />
                            <RadioButtonLabel />
                            <div>Auto accept better price only</div>
                        </Item>
                        <Item>
                            <RadioButton
                            type="radio"
                            name="radio"
                            value="anyPriceChange"
                            checked={select === "anyPriceChange"}
                            onChange={(event) => handleSelectChange(event)}
                            />
                            <RadioButtonLabel />
                            <div>Auto accept any price change</div>
                        </Item>
                        <Item>
                            <RadioButton
                            type="radio"
                            name="radio"
                            value="neverAutoAccept"
                            checked={select === "neverAutoAccept"}
                            onChange={(event) => handleSelectChange(event)}
                            />
                            <RadioButtonLabel />
                            <div>Never auto accept a price change</div>
                        </Item>
                    </Wrapper>
                 </div>
            </>
        )
    }
}

export default RegistrationStep6;
